import Modal from "react-modal";
import classes from "./PortfolioItem.module.css"

const PortfolioItem = ({ portfolio }) => {
    const PortfolioNamesDictionary = { cabin: "LOG CABIN", cake: "TASTY CAKE", circus: "CIRCUS TENT", game: "CONTROLLER", safe: "LOCKED SAFE", submarine: "SUBMARINE" };
    return (
        // <Modal isOpen={isOpen} onRequestClose={closeModal}>
        <Modal isOpen={true}>
            <h1 className={classes.subtitle}>{PortfolioNamesDictionary[portfolio]}</h1>
        </Modal>
    )
}
export default PortfolioItem;
